import React, { Component } from 'react';
import data from '../services/data.json';

class Weather extends Component {
  constructor(props) {
    super(props);
    this.teste = this.teste.bind(this);
  }

  teste() {
    data.map((dataID) => {
      console.log(dataID.id)
      return(
        <div key={dataID.name}>
          {dataID.id}
        </div>
      )
    })
  }
  render() {
    return (
      <div>{this.teste()}</div>
    )
  }
}

export default Weather;
